import React from 'react';
import './input.scss';

const Input = ({ val, onChange, onSubmit }) => {
    return (
        <form onSubmit={onSubmit}>
            <input
                className=''
                onChange={e => onChange(e.target.value)}
                value={val}
                placeholder='Add Todo Here'
            />
        </form>
    )
}

export default Input;
